s or attendees on the checkout? This add-on is just for you!\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/3167/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/3167/card_banner.png\";s:15:\"selling_point_0\";s:68:\"Collect any and all the additional information about your attendees.\";s:15:\"selling_point_1\";s:128:\"Information collected from your clients via Custom Forms can be exported as PDF or CSV, can be displayed on the ticket itself or\";s:15:\"selling_point_2\";s:96:\"Create any kind of buyer or attendee forms which will fit like a glove with your theme\'s design.\";s:11:\"screenshots\";N;s:2:\"id\";s:3:\"604\";s:7:\"updated\";s:19:\"2019-03-13 13:51:02\";s:7:\"created\";s:19:\"2019-01-28 11:06:40\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_32060913427a4d49fcbaad1b976fe\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"3167\";s:7:\"updated\";s:19:\"2020-06-17 02:49:29\";s:7:\"created\";s:19:\"2019-01-24 10:54:02\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:3;O:9:\"FS_Plugin\":23:{s:16:\"parent_plugin_id\";s:4:\"3102\";s:5:\"title\";s:10:\"CSV Export\";s:4:\"slug\";s:10:\"csv-export\";s:12:\"premium_slug\";s:10:\"csv-export\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:0;s:22:\"premium_releases_count\";i:5;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:4:\"3168\";s:11:\"description\";s:308:\"With CSV add-on, you can export per-event based attendee lists in .csv file format which you can then use for external accounting system or other third party systems. Any and all of the fields for attendees are exportable and you can select which of the fields you would like to include in the exported file.\";s:17:\"short_description\";s