\";s:11:\"screenshots\";O:8:\"stdClass\":4:{s:12:\"screenshot_0\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/5269/screenshots/0.png\";s:12:\"screenshot_1\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/5269/screenshots/1.jpg\";s:12:\"screenshot_2\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/5269/screenshots/2.png\";s:12:\"screenshot_3\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/5269/screenshots/3.png\";}s:2:\"id\";s:4:\"1320\";s:7:\"updated\";s:19:\"2020-01-28 13:48:02\";s:7:\"created\";s:19:\"2019-12-31 10:24:25\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_d009e946e2ec9f76157854611ea87\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"5269\";s:7:\"updated\";s:19:\"2020-06-16 16:27:10\";s:7:\"created\";s:19:\"2019-12-31 10:06:48\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}}}}', 'yes');
