(174, 1, '2020-06-16 14:20:10', '2020-06-16 12:20:10', 'Pour qui aime l’opéra, sans nul doute le XIXe siècle est le siècle par excellence. Qu’en est-il de ce genre dramatique hybride mêlant théâtre et musique ? Comment est-il traversé par les mouvement...\r\n\r\nPour qui aime l’opéra, sans nul doute le XIXe siècle est le siècle par excellence. Qu’en est-il de ce genre dramatique hybride mêlant théâtre et musique ? Comment est-il traversé par les mouvements philosophiques, sociologiques et politiques du temps ? Quels en sont les codes, les représentations symboliques et les polémiques passionnées ? Quels en sont les enjeux esthétiques ? Après deux séances intitulées « l’abc » permettant de découvrir l’ensemble des aspects stylistiques et leurs évolutions (aussi bien en Italie, en France, en Allemagne qu’en Russie), des conférences thématiques vous invitent à pénétrer plus avant dans le monde aussi insolite qu’inouï de l’opéra romantique.', 'L\'opéra au XIXe siècle, de A à Z / Mettre en scène Wagner aujourd’hui', 'This is a simple product.', 'publish', 'open', 'closed', '', 'lopera-au-xixe-siecle-de-a-a-z-mettre-en-scene-wagner-aujourdhui', '', '', '2020-06-16 14:56:18', '2020-06-16 12:56:18', '', 0, 'http://localhost:8888/projet_sylur/?post_type=product&#038;p=174', 0, 'product', '', 0);
